  const {scrapes} = useContext(ScrapeContext)
  console.log('scrapeData', scrapes[0])
  return (<div>
    <h2>Your data</h2>
    <ul>
      {scrapes[0].instagramId}
    {/* {scrapes.map(scrape=><li key={scrape.instagramId}>scrape.instagramId</li>)} */}
    </ul>
  </div>)
}

export default Data;
